import React, { useState } from 'react';
import "./todo.css"
function Todo({name,isFinished}){
    return(
        <div>
            {isFinished?
            <div className='containerTrue'>
                {name}
            </div>
            :
            <div className='containerFalse'>
                {name}    
            </div>}
        </div>
    )
}
export default Todo;
